        <>
            <h1>Projects</h1>
            <div class="card">
                <img src="img_avatar.png" alt="Avatar" />
                    <div class="container">
                        <h4><b>John Doe</b></h4>
                        <p>Architect & Engineer</p>
                    </div>
</div>
        </>
            )
        }

        export default Projects;
